[include mainsail.cfg]

[include timelapse.cfg]

[include hardware/*.cfg]

[include macros/*.cfg]

[include user_settings/*.cfg]

[virtual_sdcard]
path: ~/printer_data/gcodes
on_error_gcode: CANCEL_PRINT

[pause_resume]

[printer]
kinematics: corexy           
max_velocity: 700            
max_accel: 20000             
#max_accel_to_decel: 10000 # deprecated
minimum_cruise_ratio: 0.5
max_z_velocity: 15
max_z_accel: 500
square_corner_velocity: 5.0

[gcode_arcs]                       
resolution: 1.0                    

[idle_timeout]
gcode: _IDLE_TIMEOUT
timeout: 1200

[exclude_object]

[force_move]
enable_force_move: true

